    "name": "Government Total Expenditure",
    "status": "active",
    "description": "Total Expenditure comprises Operating Expenditure and Development Expenditure. Development Expenditure excludes land-related expenditure from FY2001.\r\n\r\nOperating Expenditure refers to expenditure on manpower, other operating expenditure (excluding expenses on investment and agency fees on land sales), operating grants and transfers.\r\n\r\nRefinements have been made over time to the sectoral classification of Ministries' expenditure to better reflect the nature of the programmes. In FY2007, expenditure by the then-Ministry of Communications, Information and the Arts under the Info-Communications and Media Development Programme was reclassified from the Social Development sector to the Economic Development sector. In FY2013, expenditure by the Ministry of Manpower under the Financial Security programme was reclassified from the Economic Development sector to the Social Development sector.\r\n\r\nWith effect from 1 November 2012, the Ministry of Community Development, Youth and Sports (MCYS) and the Ministry of Information, Communications and the Arts (MICA) were restructured to form three Ministries: (i) MCYS was renamed the Ministry of Social and Family Development (MSF), (ii) MICA was renamed the Ministry of Communications and Information (MCI) and (iii) the new Ministry of Culture, Community and Youth (MCCY) was formed to undertake functions transferred from MCYS and MICA.",
